def dc_play(files):
    folder = unzip(files)
    music = unzip(files, True)
    layout = [[Text('选择要播放的谱面')]]
    for i in folder:
        layout.append([[Radio(i['meta']['version'], 'radio1', key=i['meta']['version'])]])
    layout.append([[OK(key='button1')]])
    window = Window('Play', layout)
    while True:
        event, values = window.read(timeout=0)
        if event in (None, 'Exit'):
            break
        if event == 'button1':
            for i in folder:
                if values[i['meta']['version']]:
                    file, offset = tran(i, True)
                    bpm = i['time'][0]['bpm']
                    speed = i['effect']
                    for j in range(len(speed)):
                        speed[j]['beat'] = beat_for_bpm(speed[j]['beat'])
                    break
            window.close()
            break
    for i in range(len(file)):
        file[i] = [int(file[i][0]), file[i][2:].split('-')]
        for j in range(len(file[i][1])):
            file[i][1][j] = round(float(file[i][1][j]) * 60 / bpm, 3)
        if len(file[i][1]) == 2:
            file[i].insert(0, 'hold')
        else:
            file[i].insert(0, 'note')
        file[i].append(False)
        file[i].append(True)
    for i in range(len(file)):
        for j in range(i + 1, len(file)):
            if file[i][2] == file[j][2]:
                if file[i][4]:
                    file[j][4] = False
                file[i][3] = True
                file[j][3] = True
    for i in range(len(file)):
        if file[i][0] == 'hold':
            file[i] = {
                'type': file[i][0],
                'column': file[i][1],
                'timing': file[i][2][0] + offset,
                'end_timing': file[i][2][1] + offset,
                'double': file[i][3],
                'pos': 0.0,
                'end_pos': 0.0,
                'key': file[i][4]
            }
        else:
            file[i] = {
                'type': file[i][0],
                'column': file[i][1],
                'timing': file[i][2][0] + offset,
                'double': file[i][3],
                'pos': 0.0,
                'key': file[i][4]
            }
    for i in range(len(speed)):
        speed[i] = {
            'type': 'speed',
            'timing': round(speed[i]['beat'] * 60 / bpm, 3) + offset,
            'scroll': speed[i]['scroll'],
            'pos': 0.0
        }
    speed.append({
        'type': 'speed',
        'timing': 0.0,
        'scroll': 1.0,
        'pos': 0.0
    })
    speed = sorted(speed, key=lambda time:time['timing'])
    notes = []
    holds = []
    for i in file:
        if i['type'] == 'note':
            notes.append(i)
        if i['type'] == 'hold':
            holds.append(i)
    notes = sorted((notes + speed), key=lambda time: time['timing'])
    pos = 0
    scroll = 1.0
    for i in range(len(speed)):
        o = i - 1
        if o < 0:
            o = 0
        pos += (speed[i]['timing'] - speed[o]['timing']) * speed[o]['scroll']
        speed[i]['pos'] = pos
    pos = 0
    for i in range(len(notes)):
        o = i - 1
        if o < 0:
            o = 0
        pos += (notes[i]['timing'] - notes[o]['timing']) * scroll
        notes[i]['pos'] = pos
        if notes[i]['type'] == 'speed':
            scroll = notes[i]['scroll']
    for i in range(len(holds)):
        index = 0
        for j in speed:
            index += 1
            if holds[i]['timing'] < j['timing']:
                index -= 1
                break
            holds[i]['pos'] = round(((holds[i]['timing'] - j['timing']) * j['scroll'] + j['pos']) * 1000)
        index = 0
        for j in speed:
            index += 1
            if holds[i]['end_timing'] < j['timing']:
                index -= 1
                break
            holds[i]['end_pos'] = round(((holds[i]['end_timing'] - j['timing']) * j['scroll'] + j['pos']) * 1000)
    play_scene(notes, holds, music)


def unzip(file, music=False):
    zips = ZipFile(file)
    if music:
        for i in zips.namelist():
            if i[-3:] == 'ogg':
                return zips.open(i)
    mc_list = []
    for i in zips.namelist():
        if i[-2:] == 'mc':
            mc_list.append(loads(zips.read(i)))
    return mc_list


def trans(file, svfile, check):
    folder = unzip(file)
    name_list = []
    layout = [[Text('请选择要转换的版本')]]
    for i in folder:
        name_list.append(i['meta']['version'])
        layout.append([[Check(i['meta']['version'], key=i['meta']['version'])]])
    layout.append([[OK(key='button1')]])
    window = Window('请选择要转换的谱面', layout)
    select_chart = []
    txt_list = []
    while True:
        event, values = window.read(timeout=0)
        if event in (None, 'Exit'):
            break
        if event == 'button1':
            for i in name_list:
                if values[i]:
                    select_chart.append(i)
            window.close()
            break
    for i in folder:
        if i['meta']['version'] in select_chart:
            txt, speed = tran(i)
            txt_list.append(txt)
    chdir(svfile)
    try:
        mkdir(file.split('/')[-1][:-4])
    except:
        pass
    chdir(file.split('/')[-1][:-4])
    for i in txt_list:
        files = open(f"{i['name']}，{i['offset']}，{i['bpm']}.txt", 'w')
        files.write(i['text'])
        files.close()
    if check:
        speed_list = []
        for i in speed:
            beat = beat_for_bpm(i['beat'])
            speed_list.append(f"{beat},{round(i['scroll'], 3)}")
        files = open('speed_sv.txt', 'w')
        files.write('\n'.join(speed_list))
        files.close()


def tran(i, play=False):
    name = i['meta']['version']
    global bpm_list
    global first_beat
    bpm_list = i['time']
    first_beat = i['note'][0]['beat'][0] + i['note'][0]['beat'][1] / i['note'][0]['beat'][2]
    note_list = i['note'][:-1]
    offset = 0
    if 'offset' in i['note'][-1]:
        offset = -i['note'][-1]['offset'] / 1000
    speed = i['effect']
    for o in range(len(bpm_list)):
        bpm_list[o]['beat'] = bpm_list[o]['beat'][0] + bpm_list[o]['beat'][1] / bpm_list[o]['beat'][2]
        bpm_list[o]['bpm'] = round(bpm_list[o]['bpm'], 10)
    for o in range(len(bpm_list) - 1):
        bpm_list[o + 1]['len'] = (bpm_list[o + 1]['beat'] - bpm_list[o]['beat']) \
                                 * bpm_list[0]['bpm'] / bpm_list[o]['bpm']
    bpm_list[0]['len'] = 0
    txt = []
    for o in note_list:
        if 'endbeat' in o:
            txt.append(f"{o['column'] + 1}-{beat_for_bpm(o['beat'])}-{beat_for_bpm(o['endbeat'])}")
        else:
            txt.append(f"{o['column'] + 1}-{beat_for_bpm(o['beat'])}")
    offset += first_beat * 60 / bpm_list[0]['bpm']
    offset += (bpm_list[0]['bpm'] + 155) / 2500
    offset = round(offset, 3)
    if play:
        return txt, offset
    for o in range(len(txt)):
        if txt[o] == ' ':
            continue
        for p in range(o + 1, len(txt)):
            if txt[p] == ' ':
                continue
            if txt[o][1:] == txt[p][1:] and txt[o][1] == '-' and txt[p][1] == '-':
                txt[o] = f'{txt[o][0]}{txt[p][0]}{txt[o][1:]}'
                txt[p] = ' '
    while ' ' in txt:
        txt.remove(' ')
    return {
               'name': name,
               'offset': offset,
               'bpm': bpm_list[0]['bpm'],
               'text': '\n'.join(txt)
           }, speed


def beat_for_bpm(beat):
    global bpm_list
    global first_beat
    beat = beat[0] + beat[1] / beat[2]
    count = 0
    for i in range(len(bpm_list)):
        count = i
        if beat < bpm_list[i]['beat']:
            count -= 1
            break
    beat -= bpm_list[count]['beat']
    beat = beat * bpm_list[0]['bpm'] / bpm_list[count]['bpm']
    beat -= first_beat
    for i in range(count + 1):
        beat += bpm_list[i]['len']
    beat = round(beat, 3)
    if beat % 1 == 0.0:
        return int(beat)
    return beat


blue = ""
yellow = ""
bhold = ""
yhold = ""
keysound = b''



screen_size = 800
cheng = screen_size / 800
b_note = pygame.image.fromstring(b64decode(blue), (60, 60), 'RGBA')
y_note = pygame.image.fromstring(b64decode(yellow), (60, 60), 'RGBA')
b_hold = pygame.image.fromstring(b64decode(bhold), (320, 60), 'RGBA')
y_hold = pygame.image.fromstring(b64decode(yhold), (320, 60), 'RGBA')

b_note = pygame.transform.scale(b_note, (round(b_note.get_width() * cheng), round(b_note.get_height() * cheng)))
y_note = pygame.transform.scale(y_note, (round(y_note.get_width() * cheng), round(y_note.get_height() * cheng)))
b_hold = pygame.transform.scale(b_hold, (round(b_hold.get_width() * cheng), round(b_hold.get_height() * cheng)))
y_hold = pygame.transform.scale(y_hold, (round(y_hold.get_width() * cheng), round(y_hold.get_height() * cheng)))
note_speed = 500
note_st = 70
note_start = note_st * screen_size / 800
key_file = b64decode(keysound)
key_sound = None


class Note:
    cs = ((-0.5, -0.866),
          (-1, 0),
          (-0.5, 0.866),
          (0.5, -0.866),
          (1, 0),
          (0.5, 0.866))
    pos_x = screen_size / 2
    pos_y = screen_size / 2

    def __init__(self, obj):
        self.column = obj['column'] - 1
        self.time = round(obj['timing'] * 1000)
        self.pos = round(obj['pos'] * 1000)
        self.cos = self.cs[self.column][0]
        self.sin = self.cs[self.column][1]
        if obj['double']:
            self.image = y_note
        else:
            self.image = b_note
        self.display = True
        self.pos_x += note_start * self.cos
        self.pos_y += note_start * self.sin
        self.sound = True
        if not obj['key']:
            self.sound = False

    def update(self, timing, pos, screen):
        if self.display:
            if self.time - 125 < timing and self.sound:
                self.sound = False
                key_sound.play()
            if self.time < timing:
                self.display = False
                return [False, self.pos, 0, self.time, True]
            elif -note_speed * 2 < (delta := (self.pos - pos)) < note_speed:
                if delta > (half_speed := (note_speed / 2)):
                    delta -= half_speed
                    image = pygame.transform.scale(self.image, (round(self.image.get_height() - self.image.get_height() * delta / half_speed),) * 2)
                    pos_x = self.pos_x
                    pos_y = self.pos_y
                else:
                    image = pygame.transform.scale(self.image, (self.image.get_height(),) * 2)
                    pos_x = self.pos_x - ((delta - half_speed) * self.cos) * (300 * cheng - note_start) / half_speed
                    pos_y = self.pos_y - ((delta - half_speed) * self.sin) * (300 * cheng - note_start) / half_speed
                rect = image.get_rect()
                rect.center = (pos_x, pos_y)
                screen.blit(image, rect)
            return [False, 0, 0, 0, False]
        return [False, 0, 0, 0, False]


class Speed:
    def __init__(self, obj):
        self.time = round(obj['timing'] * 1000)
        self.pos = round(obj['pos'] * 1000)
        self.scroll = obj['scroll']
        self.get = True

    def update(self, timing, pos, screen):
        if self.get:
            if self.time < timing:
                self.get = False
                return [True, self.pos, self.scroll, self.time, True]
            return [False, 0, 0, 0, False]
        return [False, 0, 0, 0, False]


class Hold:
    cs = ((-0.5, -0.866),
          (-1, 0),
          (-0.5, 0.866),
          (0.5, -0.866),
          (1, 0),
          (0.5, 0.866))
    angle = (120, 180, 240, 60, 0, -60)
    pos_x = screen_size / 2
    pos_y = screen_size / 2
    end_x = screen_size / 2
    end_y = screen_size / 2

    def __init__(self, obj):
        self.time = round(obj['timing'] * 1000)
        self.end_time = round(obj['end_timing'] * 1000)
        self.column = obj['column'] - 1
        self.pos = obj['pos']
        self.end_pos = obj['end_pos']
        if obj['double']:
            self.image = y_note
            self.hold = y_hold
        else:
            self.image = b_note
            self.hold = b_hold
        self.cos = self.cs[self.column][0]
        self.sin = self.cs[self.column][1]
        self.pos_x += note_start * self.cos
        self.pos_y += note_start * self.sin
        self.end_x += note_start * self.cos
        self.end_y += note_start * self.sin
        self.angle = self.angle[self.column]
        self.display = True
        self.sound = True
        if not obj['key']:
            self.sound = False

    def update(self, timing, pos, screen):
        if self.display:
            if self.time - 125 < timing and self.sound:
                self.sound = False
                key_sound.play()
            if self.end_time < timing:
                self.display = False
            elif (delta := self.pos - pos) < note_speed:
                if delta > (half_speed := (note_speed / 2)):
                    delta -= half_speed
                    image = pygame.transform.scale(self.image, (round(self.image.get_height() - self.image.get_height() * delta / half_speed),) * 2)
                    pos_x = self.pos_x
                    pos_y = self.pos_y
                else:
                    image = pygame.transform.scale(self.image, (self.image.get_height(),) * 2)
                    pos_x = self.pos_x - ((delta - half_speed) * self.cos) * (300 * cheng - note_start) / half_speed
                    pos_y = self.pos_y - ((delta - half_speed) * self.sin) * (300 * cheng - note_start) / half_speed
                    hold_x = self.pos_x
                    hold_y = self.pos_y
                    a = note_start
                    if (delta2 := (self.end_pos - pos)) < half_speed:
                        hold_x = self.pos_x - ((delta2 - half_speed) * self.cos) * (300 * cheng - note_start) / half_speed
                        hold_y = self.pos_y - ((delta2 - half_speed) * self.sin) * (300 * cheng - note_start) / half_speed
                        a = note_start - (delta2 - half_speed) * (300 * cheng - note_start) / half_speed
                    image2 = pygame.transform.scale(self.image, (self.image.get_height(),) * 2)
                    rect2 = image2.get_rect()
                    rect2.center = (hold_x, hold_y)
                    b = note_start - (delta - half_speed) * (300 * cheng - note_start) / half_speed
                    if self.time < timing:
                        image = pygame.transform.scale(self.image, (self.image.get_height(),) * 2)
                        pos_x = self.pos_x + (half_speed * self.cos) * (300 * cheng - note_start) / half_speed
                        pos_y = self.pos_y + (half_speed * self.sin) * (300 * cheng - note_start) / half_speed
                        b = 300 * cheng
                    body_x = round((pos_x + hold_x) / 2)
                    body_y = round((pos_y + hold_y) / 2)
                    body_width = round(b - a)
                    if body_width <= 0:
                        body_width = 1
                    body_image = pygame.transform.scale(self.hold, (body_width, self.hold.get_height()))
                    body_image = pygame.transform.rotate(body_image, self.angle)
                    body_rect = body_image.get_rect()
                    body_rect.center = (body_x, body_y)
                    screen.blit(body_image, body_rect)
                    screen.blit(image2, rect2)
                rect = image.get_rect()
                rect.center = (pos_x, pos_y)
                screen.blit(image, rect)


def play_scene(note, hold, music):
    pygame.init()
    global key_sound
    key_sound = pygame.mixer.Sound(key_file)
    key_sound.set_volume(0.15)
    len_time = round(note[-1]['timing'] * 1000)
    main_pos = 0
    times = 0
    speed = 1.0
    screen = pygame.display.set_mode((screen_size, round(screen_size * 9 / 8)))
    pygame.display.set_caption('播放窗口')
    pygame.mixer.music.load(music)
    pygame.mixer.music.play()
    circle = ((700, 400), (550, 659.808), (250, 659.808), (100, 400), (250, 140.192), (550, 140.192))
    line = ((400, 746), (100.355, 573), (100.355, 227), (400, 54), (699.645, 227), (699.645, 573))
    circle = [(x * cheng, y * cheng) for (x, y) in circle]
    line = [(x * cheng, y * cheng) for (x, y) in line]
    for i in range(len(note)):
        if note[i]['type'] == 'note':
            note[i] = Note(note[i])
        elif note[i]['type'] == 'speed':
            note[i] = Speed(note[i])
    for i in range(len(hold)):
        hold[i] = Hold(hold[i])
    delay = 0
    trues = True
    while trues:
        delta_time = pygame.mixer.music.get_pos() + delay - times
        times = pygame.mixer.music.get_pos() + delay
        main_pos += delta_time * speed
        screen.fill((0, 0, 0))
        for i in range(6):
            pygame.draw.circle(screen, (255, 155, 0), circle[i], round(10 * cheng), round(10 * cheng))
            pygame.draw.line(screen, (255, 155, 0), line[i], line[(i + 1) % 6], round(5 * cheng))
        for i in note:
            gets = i.update(times, main_pos, screen)
            if gets[0]:
                main_pos = gets[1] + (times - gets[3]) * gets[2]
                speed = gets[2]
            if gets[4]:
                main_pos = gets[1] + (times - gets[3]) * gets[2]
        for i in hold:
            i.update(times, main_pos, screen)
        pygame.draw.line(screen, (255, 155, 0), (screen_size / 11, screen_size * 85 / 80), (screen_size / 11 + screen_size / 11 * 9 * (times / len_time), screen_size * 85 / 80), round(10 * cheng))
        pygame.display.flip()
        if not pygame.mixer.music.get_busy() == 1:
            pygame.quit()
            trues = False
            break
        for e in pygame.event.get():
            if e.type == pygame.QUIT:
                pygame.quit()
                trues = False
                break


